import React from "react";
import NavBar from "@components/navBar"
import { observer, inject } from "mobx-react"
import "./style.scss"
type UserInfoProps = {
 userState: UserState
}
const UserInfo = (props: UserInfoProps) => {
 const { userState } = props as propsData;
 const { pullRed } = userState as UserState;
 return (
  <div className="userinfo">
   <div className="user-info-top">
    <p className="user-left"></p>
    <p className="user-right"></p>
    <p className="user-header"></p>
   </div>
   <NavBar />
  </div>
 )
}
export default inject('userState')((observer(UserInfo)));
